create table temporal_producto (
	ch_afecta_detra INT,
	vc_codigo VARCHAR(50),
	vc_desc VARCHAR(50),
	in_estado VARCHAR(50),
	se_itipo_calc VARCHAR(50),
	nu_mnonto_isc VARCHAR(20),
	ch_uni_medida VARCHAR(50),
	nu_precio_unit VARCHAR(20),
	nu_monto_isc VARCHAR(20)
);


ch_afecta_detra,
vc_codigo,
vc_desc,
in_estado, ts_fec_creacion, ts_fec_modifica, se_ientidad,
se_itipo_calc,
nu_mnonto_isc,
ch_uni_medida, vc_usu_creacion, vc_usu_modifica,
nu_monto_isc, nu_precio_unit, ts_fec_sincronizado, in_estado_sincronizado)
select 
ch_afecta_detra,
vc_codigo, 
vc_desc, 
in_estado, current_timestamp, current_timestamp, 1 , 
se_itipo_calc, 
nu_mnonto_isc, 
ch_uni_medida, 'offline', 'offline', 
nu_monto_isc, nu_precio_unit, current_timestamp, 1  from temporal_producto ;

